<!DOCTYPE html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(79.5, 35.0);
			ctx.lineTo(79.5, 65.0);
			ctx.stroke();

			// #path5
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(95.0, 49.5);
			ctx.lineTo(79.187694, 49.422779);
			ctx.stroke();

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(79.149344, 49.423618);
			ctx.lineTo(5.0, 49.5);
			ctx.stroke();
		</script>
	</body>
</html>
